import React, { Component } from 'react'

export default class Counter extends Component {
    constructor(props) {
        super()
        this.state={mounted:true}

    }
    handleMount() {
        this.setState({mounted:true})
    }
    unhandleMount() {
        this.setState({mounted:true})
    }
    render(){
        return (
            <div>
                <button onClick={() => this.handleMount()}></button>
                <button onClick={() => this.unhandleMount()}></button>
            </div>
        )
    }
}
